import './App.css';
import React, { Component } from 'react';
import ArticlePost from './ArticlePost';
import ArticleList from './ArticleList';

class App extends Component {

  render() {
    return (
      <div className="App" class="container">
        <div class="row">
          <div class="col-md-4">
            <ArticlePost/>
          </div>
          <div class="col-md-8">
            <ArticleList/>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
